Problem: four distinct integers $a$, $b$ and $c$ and $d$ have the property that when added in pairs, the sums 10, 18, 19, 20, 21, and 29 are obtained. what are the four integers in increasing order? (place a comma and space between each integer)

assistant
To solve for the four distinct integers \(a\), \(b\), \(c\), and \(d\) such that their pairwise sums are 10, 18, 19, 20, 21, and 29, we can follow these steps:

1. **Identify the smallest and largest sums:**
   - The smallest sum is \(a + b = 10\).
   - The largest sum is \(c + d = 29\).

2. **Sum of all pairwise sums:**
   - The sum of all given pairwise sums is:
     \[
     10 + 18 + 19 + 20 + 21 + 29 = 117
     \]
   - Each integer appears in exactly 3 pairs. Therefore, the sum of all pairwise sums is also equal to:
     \[
     3(a + b + c + d)
     \]
   - Setting these two expressions equal gives:
     \[
     3(a + b + c + d) = 117
     \]
   - Solving for \(a + b + c + d\):
     \[
     a + b + c + d = \frac{117}{3} = 39
     \]

3. **Sum of the smallest and largest integers:**
   - We already know \(a + b = 10\) and \(c + d = 29\). Adding these two equations:
     \[
     (a + b) + (c + d) = 10 + 29 = 39
     \]
   - This confirms our total sum calculation.

4. **Find the remaining sums:**
   - The remaining sums are 18, 19, 20, and 21. We need to pair these sums with \(a\), \(b\), \(c\), and \(d\) such that each pair sums to one of these values.

5. **Determine the pairs:**
   - Since \(a + b = 10\) and \(c + d = 29\), we need to find pairs from the remaining sums that add up to the remaining total sums when combined with \(a\), \(b\), \(c\), and \(d\).

6. **Assume \(a < b < c < d\):**
   - Let \(a + c = x\), \(a + d = y\), \(b + c = z\), and \(b + d = w\).
   - We know:
     \[
     x + y + z + w = 18 + 19 + 20 + 21 = 88
     \]
   - We also know:
     \[
     (a + b) + (a + c) + (a + d) + (b + c) + (b + d) + (c + d) = 3(a + b + c + d) = 117
     \]
   - Therefore:
     \[
     x + y + z + w + (a + b + c + d) = 117
     \]
   - Substituting \(a + b + c + d = 39\):
     \[
     x + y + z + w + 39 = 117
     \]
     \[
     x + y + z + w = 78
     \]

7. **Correct assumption and solving:**
